const SelectLevel = () => {
    const ghgh = true;
    return (
        <div className="flex justify-around items-center w-full h-[50%] pt-[1%]">
            {levels.map((level) => {
                <div className="w-[10%] h-[20%] font-['MaplestoryOTFBold'] text-xl">{level}</div>    
            })}
            
            <div className={`w-[7%] h-[80%] font-['MaplestoryOTFBold'] text-xl ${ ghgh ? `border border-yellow bg-iceBlue` : ``}`}>하</div>
            <div className="w-[10%] h-[20%] font-['MaplestoryOTFBold'] text-xl">중</div>
            <div className="w-[10%] h-[20%] font-['MaplestoryOTFBold'] text-xl">상</div>
        </div>
    )
}

export default SelectLevel;
